import styled from "styled-components";
import ContentList from "../ContentList";
import TitleBox from "../TitleBox";

const filters = {
  trend: [
    { id: 1, text: "오늘", url: "/trending/all/day", active: true },
    { id: 2, text: "이번주", url: "/trending/all/week", active: false },
  ],
  popular: [
    { id: 1, text: "영화", url: "/popular/movie", active: true },
    { id: 2, text: "TV", url: "/popular/TV", active: false },
    { id: 3, text: "인물", url: "/popular/person", active: false },
  ],
};

function Home() {
  return (
    <Container>
      <ContentList>
        <TitleBox title="트렌딩" filter={filters.trend} />
      </ContentList>
      <ContentList>
        <TitleBox title="트렌딩" filter={filters.trend} />
      </ContentList>
    </Container>
  );
}

const Container = styled.div`
  max-width: 900px;
  margin: 0 auto;
`;

export default Home;
